import { useSelector } from "react-redux"
import styles from './FilterBar.module.css'
function FilterBar(){
    const genres = useSelector(initialState => initialState.gamesGenres)

    return(
        <nav className={styles.genresBar}>
            <ul>
                <li>
                {genres.map(each => {
                    return(<p>{each}</p>)
                })}
                </li>
            </ul>
        </nav>
    )
}

export default FilterBar
